import React, { useRef, useEffect, useState } from "react";
import { Row, Col, Button, Carousel } from "antd";
import list from "../assets/list.json";
import Question from "../components/Question";

const Dog = () => {
	const carouselRef = useRef();
	const arr = list.arr;

	const displayArr = () => {
		arr.map((c) => {
			return <Question index={c.id} key={c.id} />;
		});
	};

	return (
		<>
			<Row justify="center">
				<Carousel
					dotPosition="left"
					ref={carouselRef}
					dots="false"
					effect="scrollx"
					style={{ marginTop: "100px" }}
				>
					{displayArr()}
				</Carousel>
			</Row>
		</>
	);
};

export default Dog;
